/* Samples Gallery wGridStyles Widget, this widget demonstrates different grid styles that DreamFace provide. */
var wGridStyles = angular.module("wGridStyles",[]);

wGridStyles.controller( "wGridStylesController", function( $scope ) {
    //Calling the Datagrid data from query
	var dq = new DataQuery( 'qGetcUsers' );
    dq.execute().
    	done( function() {
    		$scope.$apply(function() {
    			$scope.results = dq.getData().data;
    		});
    	});

});
